import React from "react";
import { MdDelete } from "react-icons/md";


export default function TodoLists(props) {
  return (
   
      <div class="container-fluid mt-2 bg-secondary">
       
        <button class="deletebtn "
          onClick={() => {
            props.RemoveBtn(props.id);
          }}
        >
          <MdDelete/>
        </button>
        {props.lists}
      </div>

  );
}
